css:
.atomatigit {
  position: relative;
  width: 30em;
  padding: 0px;
  border-left: 1px solid #181a1f;
  background-color: #16181d;
  color: #9da5b4;
  display: -webkit-flex;
  -webkit-flex-direction: column;
  height: 100vh;
}
.atomatigit .hidden {
  display: none;
}
.atomatigit .spinner {
  position: absolute;
  top: 1.5em;
  left: 1.5em;
  display: none;
}
.atomatigit .resize-handle {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  width: 10px;
  cursor: col-resize;
}
.atomatigit .input {
  background-color: #16181d;
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  width: 100%;
  padding: 0px 1.5em 1em;
  margin: 0px;
  display: none;
}
.atomatigit .input.block atom-text-editor {
  height: 100px;
}
.atomatigit .commit-list-view .commit {
  padding: 0.5em 0px;
}
.atomatigit .commit-list-view .commit .id {
  font-weight: bold;
  display: inline-block;
  padding-left: 1.5em;
}
.atomatigit .commit-list-view .commit .author-name {
  font-style: italic;
  display: inline-block;
  padding-left: 0.5em;
}
.atomatigit .commit-list-view .commit .message {
  padding-left: 1.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.atomatigit .file .mode {
  padding: 0.5em;
  padding-left: 2.5em;
}
.atomatigit .file .diff {
  font-family: monospace;
}
.atomatigit .file .diff .diff-chunk {
  padding: 1em 0px;
  border-bottom: 1px solid #181a1f;
}
.atomatigit .file .diff .diff-chunk.selected {
  background-color: #fff;
}
.atomatigit .file .diff .diff-chunk .diff-line {
  padding-left: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.atomatigit .file .diff .diff-chunk .diff-line.addition {
  background-color: #213a39;
}
.atomatigit .file .diff .diff-chunk .diff-line.subtraction {
  background-color: #3d252a;
}
.atomatigit h2 {
  padding-left: 1.5em;
  font-size: 1.2em;
  font-weight: bold;
}
.atomatigit .branch-brief-view {
  padding: 0.5em;
  padding-left: 2.5em;
}
.atomatigit .branch-brief-view .name {
  margin: 0px;
  font-weight: bold;
}
.atomatigit .branch-brief-view .commit {
  font-style: italic;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.atomatigit .branch-brief-view:hover {
  background-color: #3a3f4b;
  cursor: pointer;
}
.atomatigit .current-branch-view {
  text-align: right;
  padding: 2em;
  padding-bottom: 1em;
  background-color: #16181d;
  -webkit-flex: 0 0 auto;
}
.atomatigit .current-branch-view.selected {
  background-color: #16181d;
}
.atomatigit .current-branch-view.unpushed {
  color: #e2c08d;
}
.atomatigit .current-branch-view .name {
  display: block;
  font-size: 2em;
  font-weight: bold;
}
.atomatigit .current-branch-view .commit {
  display: block;
}
.atomatigit .current-branch-view:hover {
  background-color: #16181d;
}
.atomatigit .lists {
  -webkit-flex: 1 1 auto;
  overflow: auto;
}
.atomatigit.focused {
  background-color: #1d2025;
  border-left: solid 1px #3a3f4b;
}
.atomatigit.focused .selected .filename,
.atomatigit.focused .branch-brief-view.selected,
.atomatigit.focused .commit.selected,
.atomatigit.focused .file.selected {
  background-color: #3a3f4b;
}
.atomatigit.focused .selected .filename .message,
.atomatigit.focused .branch-brief-view.selected .message,
.atomatigit.focused .commit.selected .message,
.atomatigit.focused .file.selected .message {
  color: #9da5b4;
}
.atomatigit.focused .current-branch-view .name {
  color: #3a3f4b;
}
.atomatigit .tab-bar {
  display: -webkit-flex;
  -webkit-flex: 0 0 auto;
  margin: 0px;
  border-bottom: 0px #fff;
  background: #16181d;
}
.atomatigit .tab-bar .tab {
  -webkit-flex: 1;
  font-size: 11px;
  position: relative;
  padding-left: 10px;
  padding-right: 10px;
  max-width: 100px;
  min-width: 40px;
}
.atomatigit .tab-bar .tab.active {
  -webkit-flex: 2;
}
.atomatigit .tab-bar .tab .title {
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
}
.atomatigit .tab-bar .tab .title:first-letter {
  text-decoration: underline;
}
.atomatigit-error .error-message {
  background-color: #000;
  color: #FF6600;
}
